INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Beatae vero eveniet voluptates quae ut modi.', 'Laboriosam autem hic temporibus facere dicta. Occaecati impedit ut iusto rerum modi quia. Animi dolores ipsa qui sed architecto corporis. Expedita laudantium ducimus itaque.', 'Et nihil asperiores rerum fuga eaque porro. Soluta provident quisquam ut dolores et eos odio. Reiciendis id quasi ullam velit at. Atque sequi rerum sed est nulla omnis ratione.', '1984-02-28');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Soluta ut aut id ducimus expedita vitae quos voluptas.', 'Ad debitis ipsum velit velit ut. Autem atque doloremque molestiae iusto expedita. Dolore temporibus et consequuntur eveniet eos accusantium et. Eos ut culpa voluptates repudiandae tenetur provident corporis. Nulla ducimus similique quas reiciendis.', 'Nam autem perspiciatis ad. Autem suscipit voluptas sint eaque quidem eos. Perferendis vitae voluptas delectus esse. Voluptas cupiditate nihil id ut cupiditate cupiditate reiciendis necessitatibus.', '1980-09-19');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Blanditiis expedita est laboriosam magnam exercitationem aut.', 'Aspernatur ea sunt voluptas saepe et esse. Omnis est nihil quam est. Et neque quam animi unde.', 'Maiores tempore aut veniam atque est. Illum ducimus accusantium perferendis consequatur qui molestiae voluptates consequatur. Beatae officiis nulla amet rerum dolores nobis voluptatem.', '1975-10-04');
